import React from 'react';
import styled from 'styled-components';

function SkeletonTopBanner() {
	return (
		<ComponentWrapper>
			<div>
				<div className="box-img-wrapper">
					<img
						src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Fbanners%2F1739%2F479066c4.jpg&amp;w=1060&amp;q=100"
						alt="OO으로 생산성과 창의성을 높인다?!"
					/>
				</div>
			</div>
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	height: auto;
	position: relative;
	overflow: hidden;
	display: flex;
	> div {
		display: inline-block;
		padding: 0 12px;
		width: 1060px;
	}
`;

export default SkeletonTopBanner;
